<!DOCTYPE html>
<html lang="sv">
<head>
<meta charset="utf-8">
<meta name="viewport" content="width=device-width, initial-scale=1">
<title>Planritning – Heimstaden</title>
<style>
  :root{--orange:#f37021;--bg:#0b1220}
  html,body{height:100%}
  body{margin:0;background:var(--bg);color:#e5e7eb;font-family:-apple-system,BlinkMacSystemFont,"Segoe UI",Roboto,Inter,Arial,sans-serif}
  .wrap{position:relative;min-height:100vh;overflow:hidden;padding:12px}
  .board{position:relative;width:min(1200px,100%);margin:0 auto;background:#0f172a;border-radius:14px;overflow:hidden;box-shadow:0 20px 50px rgba(0,0,0,.35)}
  .img-holder{position:relative;line-height:0}
  .img-holder img{display:block;width:100%;height:auto;user-select:none;-webkit-user-drag:none}
  .dot{position:absolute;width:22px;height:22px;border-radius:999px;border:2px solid rgba(255,255,255,.95);box-shadow:0 4px 10px rgba(0,0,0,.25);cursor:pointer;transition:transform .12s ease,box-shadow .12s ease}
  .dot:hover{transform:scale(1.12);box-shadow:0 0 0 6px rgba(243,112,33,.18),0 4px 10px rgba(0,0,0,.25)}
  .dot.default{background:#f37021}.dot.secondary{background:#22c55e}.dot.tertiary{background:#eab308}.dot.quaternary{background:#f43f5e}.dot.neutral{background:#94a3b8}
  .dot::after{content:attr(aria-label);position:absolute;left:50%;transform:translateX(-50%);top:140%;background:rgba(15,23,42,.92);color:#e2e8f0;padding:6px 10px;border-radius:8px;border:1px solid rgba(226,232,240,.12);font-size:12px;white-space:nowrap;opacity:0;transition:opacity .12s ease;pointer-events:none}
  .dot:hover::after{opacity:1}
  .modal{position:fixed;inset:0;display:none;align-items:center;justify-content:center;background:rgba(2,6,23,.7);z-index:60}
  .modal.open{display:flex;animation:fadeIn .18s ease both}
  @keyframes fadeIn{from{opacity:0}to{opacity:1}}
  .card{width:min(1100px,95vw);border-radius:14px;overflow:hidden;background:#0b1220;border:1px solid rgba(148,163,184,.22);box-shadow:0 30px 80px rgba(0,0,0,.55);animation:pop .2s ease both}
  @keyframes pop{from{transform:translateY(8px);opacity:0}to{transform:none;opacity:1}}
  .card header{display:flex;align-items:center;justify-content:space-between;padding:10px 14px;background:rgba(15,23,42,.96);border-bottom:1px solid rgba(148,163,184,.22)}
  .card h2{font-size:16px;margin:0;color:#e2e8f0}
  .card img{display:block;width:100%;height:auto}
  .controls{display:flex;align-items:center;justify-content:space-between;padding:8px 14px;background:rgba(15,23,42,.96)}
  .btn{appearance:none;background:rgba(15,23,42,.6);color:#e5e7eb;border:1px solid rgba(148,163,184,.3);border-radius:10px;padding:6px 10px;cursor:pointer}
  .btn:hover{background:rgba(15,23,42,.8)}
  #counter{font-size:13px;color:#94a3b8}
  .fs-ctrl{position:absolute;right:12px;top:12px;z-index:40;background:rgba(15,23,42,.55);border:1px solid rgba(148,163,184,.25);color:#e5e7eb;border-radius:10px;padding:6px 10px;cursor:pointer;backdrop-filter:blur(6px)}
  .fs-ctrl:hover{background:rgba(15,23,42,.7)}
  .logo-badge{position:absolute;right:12px;bottom:12px;z-index:30;background:rgba(15,23,42,.55);border:1px solid rgba(148,163,184,.25);border-radius:10px;padding:6px 10px;backdrop-filter:blur(6px)}
  .logo-badge img{display:block;width:auto;height:22px}
  @media (max-width:640px){.dot{width:20px;height:20px}}
</style>
</head>
<body>
<div class="wrap">
  <div class="board" id="board">
    <button class="fs-ctrl" id="fsBtn" aria-label="Visa i helskärm">⛶</button>

<div class="modal" id="modal" role="dialog" aria-modal="true" aria-labelledby="mt">
  <div class="card">
    <header><h2 id="mt">Rum</h2><button class="btn" id="closeBtn" aria-label="Stäng">Stäng</button></header>
    <img id="mimg" alt="Rumsbild">
    <div class="controls"><button class="btn" id="prevBtn" aria-label="Föregående">&larr; Föregående</button><span id="counter">1/1</span><button class="btn" id="nextBtn" aria-label="Nästa">Nästa &rarr;</button></div>
  </div>
</div>

<script>
(function(){
  const modal=document.getElementById('modal'), mimg=document.getElementById('mimg'), mt=document.getElementById('mt');
  const closeBtn=document.getElementById('closeBtn'), prevBtn=document.getElementById('prevBtn'), nextBtn=document.getElementById('nextBtn');
  const fsBtn=document.getElementById('fsBtn'), board=document.getElementById('board');

  let gallery=[], idx=0;
  function openModal(title, imgs){ gallery = imgs && imgs.length ? imgs : []; idx = 0; if (gallery.length) mimg.src = gallery[0]; mt.textContent = title || ''; modal.classList.add('open'); updateCounter(); }
  function closeModal(){ modal.classList.remove('open'); }
  function updateCounter(){ document.getElementById('counter').textContent = (gallery.length ? (idx+1) : 0) + '/' + (gallery.length || 1); }
  function show(i){ if (!gallery.length) return; idx = (i + gallery.length) % gallery.length; mimg.src = gallery[idx]; updateCounter(); }

  document.querySelectorAll('.dot').forEach(d => {
    const m = /top:(\d+)%!?\;\s* left:(\d+)%!?/.exec(d.getAttribute('style').replace(/\s+/g,' '));
    if(m){ d.setAttribute('title', (d.getAttribute('aria-label')||'') + ' — top:'+m[1]+'%, left:'+m[2]+'%'); }
    d.addEventListener('click', () => {
      const t = d.dataset.title || d.getAttribute('aria-label') || 'Rum';
      let imgs = [];
      if (d.dataset.gallery) { try { imgs = JSON.parse(d.dataset.gallery); } catch(e) { imgs = []; } }
      else if (d.dataset.img) { imgs = [d.dataset.img]; }
      openModal(t, imgs);
    });
  });

  prevBtn.addEventListener('click', () => show(idx - 1));
  nextBtn.addEventListener('click', () => show(idx + 1));
  closeBtn.addEventListener('click', closeModal);
  modal.addEventListener('click', e => { if (e.target === modal) closeModal(); });
  document.addEventListener('keydown', e => { if (!modal.classList.contains('open')) return; if (e.key === 'Escape') closeModal(); if (e.key === 'ArrowLeft') show(idx-1); if (e.key === 'ArrowRight') show(idx+1); });

  function enterFS(){ const el = board; if (el.requestFullscreen) el.requestFullscreen(); else if (el.webkitRequestFullscreen) el.webkitRequestFullscreen(); else if (el.msRequestFullscreen) el.msRequestFullscreen(); }
  function exitFS(){ if (document.exitFullscreen) document.exitFullscreen(); else if (document.webkitExitFullscreen) document.webkitExitFullscreen(); else if (document.msExitFullscreen) document.msExitFullscreen(); }
  function inFS(){ return document.fullscreenElement || document.webkitFullscreenElement || document.msFullscreenElement; }
  function updateFSBtn(){ fsBtn.textContent = inFS() ? '✕' : '⛶'; fsBtn.setAttribute('aria-label', inFS() ? 'Stäng helskärm' : 'Visa i helskärm'); }
  fsBtn.addEventListener('click', () => { inFS() ? exitFS() : enterFS(); });
  document.addEventListener('fullscreenchange', updateFSBtn);
  document.addEventListener('webkitfullscreenchange', updateFSBtn);
  document.addEventListener('MSFullscreenChange', updateFSBtn);
  // Grid toggle on 'G'
  document.addEventListener('keydown', (e)=>{ if(e.key.toLowerCase()==='g'){ const g=document.getElementById('coordGrid'); if(g) g.style.display = (g.style.display==='none'||!g.style.display)?'block':'none'; }});
  updateFSBtn();
})();
</script>
